DROP TABLE IF EXISTS quests;
CREATE TABLE quests (
  id INTEGER PRIMARY KEY,
  name TEXT NOT NULL,
  description TEXT DEFAULT '' NOT NULL,
  fail_text TEXT DEFAULT '' NOT NULL,
  pass_text TEXT DEFAULT '' NOT NULL,
  class_restrictions BIGINT DEFAULT 0,
  min_experience BIGINT DEFAULT 0,
  max_experience BIGINT DEFAULT 0,
  min_level INT DEFAULT 0,
  max_level INT DEFAULT 0,
  repeatable CHAR(1) DEFAULT '0',
  show_progress CHAR(1) DEFAULT '0',
  only_one_player_can_complete CHAR(1) DEFAULT '0',
  prerequisite_quests TEXT DEFAULT '' NOT NULL
);

INSERT INTO quests (id, name, description, pass_text, fail_text, repeatable, show_progress)
VALUES (1, 'Snake Infestation', 'Hey there, you look new.\n Why dont you help me out\n by killing some of these dirty Snakes\n over here and i''ll point you towards\n something better?\n Kill some snakes and bring\n back a Tongue for me.', 'Good job newbie. Head North,\n make a right and go straight up\n to reach the lamb and sheep\n area. Be careful!', 'Looks like you still dont\n have that snake tongue for me eh?\n Go kill some of these snakes\n and find one.', '0', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (2, 'Annoying Lambs', 'These damn lambs and their\n annoying little bitch voices.\n Kill me 10 of these lambs\n and I shall reward you.', 'Good job.\n I can sleep a little more peaceful now.', 'How hard is it to kill 10\n lambs eh? Go do that.', 2, '0', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (3, 'Woolen Sweater', 'Hey there, I want to make me\n a nice woolen sweater.\n Hows about you slaughter some\n of these sheep and bring me\n back 5 pieces of wool?\n Theres a handy little weapon\n in it for ya.', 'Sweet. I''ll tell the missus\n to get stichin right now.', 'Still dont have those 5\n pieces of wool?\n Kill some of these sheep.', 3, '0', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, repeatable, show_progress)
VALUES (4, 'Path of the Warrior', 'Hey there, if you''re looking\n to follow the path of the\n warrior, I can make you one.\nWarriors rely on their HP\n and strength, tanking for the\n party. If raw power and high health\n interests you then get level 5,\n speak to the keeper of gems\n and bring me his gift.', 'I have transformed you into\n a warrior. I have given you\n some items to help you along\n your journey. Make me proud.', 'You do not meet the\n requirements.', 5, 5, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, repeatable, show_progress)
VALUES (5, 'Path of the Magus', 'Hey there, if you''re looking\n to follow the path of the\n Magus, I can make you one.\nMagus rely on their Mana\n and intelligence, doing high damage\n from a range. If high damage with safety\n and utility interests you then\n you then get to level 5,\n speak to the keeper of gems\n and bring me his gift.', 'I have transformed you into\n a Magus. I have given you\n some items to help you along\n your journey. Make me proud.', 'You do not meet the\n requirements.', 5, 5, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, repeatable, show_progress)
VALUES (6, 'Path of the Rogue', 'Hey there, if you''re looking\n to follow the path of the\n Rogue, I can make you one.\nRogues rely on doing high damage\n using a combination of HP and MP\n and critical strikes. If the\n path of the rogue interests you then\n you then get to level 5,\n speak to the keeper of gems\n and bring me his gift.', 'I have transformed you into\n a Rogue. I have given you\n some items to help you along\n your journey. Make me proud.', 'You do not meet the\n requirements.', 5, 5, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, repeatable, show_progress)
VALUES (7, 'Path of the Priest', 'Hey there, if you''re looking\n to follow the path of the\n Priest, I can make you one.\n Priests are vital to the survival of a party.\n They heal and provide buffs.\n If the path of the Priest interests\n you then get to level 5,\n speak to the keeper of gems\n and bring me his gift.', 'I have transformed you into\n a Priest. I have given you\n some items to help you along\n your journey. Make me proud.', 'You do not meet the\n requirements.', 5, 5, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, repeatable, show_progress)
VALUES (8, 'Keeper of Class Gems', 'Hello stranger. If you think\n you''re ready to choose a\n class, I can provide you\n with a gem to give to\n one of the 4 class\n changers.', 'Go forth and choose a class.', 'You do not meet the\n requirements.', 5, 5, '0', '1');
INSERT INTO quests (id, name, description, fail_text, repeatable, show_progress)
VALUES (9, 'Beginner assistance', 'Hey there, you look lost.\n Let me help you out.\n Start by equipping the items\n in your inventory by double\n clicking them. Press the space\n bar to attack, drag spells\n from the spellbook to the\n hotkey bar to use them\n with the number keys.\n Press comma to pick up\n drops. Thats the basics!\n Talk to Pat for your first\n quest. Once you''re level 5,\n head North and enter the\n building there to pick a class!\n Good luck!', 'Hey there, you look lost.\n Let me help you out.\n Start by equipping the items\n in your inventory by double\n clicking them. Press the space\n bar to attack, drag spells\n from the spellbook to the\n hotkey bar to use them\n with the number keys.\n Press comma to pick up\n drops. Thats the basics!\n Talk to Pat for your first\n quest. Once you''re level 5,\n head right and enter the\n building there to pick a class!\n Good luck!', '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (10, 'Cow Herder', 'Howdy stranger. Hows about helping me out?\n My darned cows have grown too large in number.\n Could you perhaps trim the herd?\n Kill some of them cows there for me\n and bring back 10 leathers as proof.\n Theres a handy little shield in it for ya!', 'Thank ye. Enjoy the shield.', 'Still not gathered 10 leather? Hunt some cows.', 6, '0', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (11, 'Angry Cow', 'Hi there handsome. Think you can help me out?\n I fed one of the cows some funky berries\n and he seems to have developed a bit\n of a temper problem. Could you go find\n him and kill him before my brother\n finds out about it? You can''t miss it,\n Its a big red cow!.', 'Why thank you kind stranger!', 'Go kill the enraged cow before patrick sees!', 8, '0', '1');
INSERT INTO quests (id, name, description, repeatable, show_progress)
VALUES (12, 'Dereks Transport Service', 'You wanna to go to Patrian?\nI can take you there for 50 gold pieces.\n\nWhat do you say? BrAAAAAAAY!!', '1', '1');
INSERT INTO quests (id, name, description, repeatable, show_progress)
VALUES (13, 'Alphonzos Transport Service', 'You wanna to go to Ipcus?\nI can take you there for 50 gold pieces.\n\n we have a deal mister?', '1', '1');
INSERT INTO quests (id, name, description, min_level, max_level, repeatable, show_progress)
VALUES (14, 'Maloha Tourism Agent', 'You look like the kind of person\nwho likes the finer things in\nlife. You should visit Maloha!\nFor just 125 gold I can send you\nthere. Sound good?\n\nClick NEXT to visit Maloha Island!\n(Maloha has a large variety of\ncaged monsters and strange sights\nto behold!)', 15, 49, '1', '1');
INSERT INTO quests (id, name, description, min_level, max_level, repeatable, show_progress)
VALUES (15, 'Askar Tourism Agent', 'You look like the kind of person\nwho likes the adventure in their\nlife. You should visit askar!\nFor just 125 gold I can send you\nthere. Sound good?\n\n Click NEXT to visit Askar!\n(Askar has a variety of cold\nhardened wildlife and is\nfilled with snowy delight!)', 20, 49, '1', '1');
INSERT INTO quests (id, name, description, min_level, max_level, repeatable, show_progress)
VALUES (16, 'Maloha Greeter', 'Welcome to Maloha! There are\nmany hunting and fishing spots\nall over the island, please\nfeel free to explore and enjoy\nyourself!\n\nClick NEXT when you are ready\nto return to the mainland, and\nI will send you back!', 15, 49, '1', '1');
INSERT INTO quests (id, name, description, min_level, repeatable, show_progress)
VALUES (17, 'Askar Greeter', 'Welcome to Askar! There are\nmany hunting spots all over\nthe area, please feel free\nto explore and enjoy\nyourself!\n\nClick NEXT when you are ready\nto return to the mainland, and\nI will send you back!', 20, '1', '1');
INSERT INTO quests (id, name, description, min_experience, min_level, repeatable, show_progress)
VALUES (18, 'Castle Relex', 'What are you doing here!? You can not\npass! At least not without giving me\nsome of your experience first. I will\nrequire you to sacrifice three\nthousand gold each time you want to go\ninside to the newly discovered Castle Relex.', 5000000000, 50, '1', '1');
INSERT INTO quests (id, name, description, min_level, repeatable, show_progress)
VALUES (19, 'Mysterious Statue', 'There''s something strange about\nthis statue...\n\n\n((You notice one of the statues\narms seems out of place..click\nnext to try and figure out\n this statues secrets...))', 30, '1', '1');
INSERT INTO quests (id, name, description, repeatable, show_progress)
VALUES (20, 'Pedestal', '...', '1', '1');
INSERT INTO quests (id, name, description, show_progress)
VALUES (21, 'Restoring Balance', 'What have you done?! By coming\nhere, you have disrupted the\neternal balance. This must be\nfixed before the world is\ndestroyed! First we must figure\nout how to enter into the spirit\nrealm...', '1');
INSERT INTO quests (id, name, description, pass_text, show_progress)
VALUES (22, 'Make Your Slimes Useful', 'Sure, Parkie and me have been back here\na long time. The Nosaerons scare the day\nlights outta me! I been usin my time to\nmake potions and food from the slimes si\nnce theyre all that live down here.\n\nLately explorers like yerself have manag\ned to wander all the way back here, so I\nbeen selling my goods to save up money\nfer when the Nosaerons are killed.\n\nCould ya help me out with something? Wha\nt I need ya to do is kill some slimes fo\nr me. If you bring me back 5 servings of\nslime goo I can pay for yer help.', 'You decided to help! Thank ya. Here, take\nsome gold for yer troubles.\n\nCome back any time!', '1');
INSERT INTO quests (id, name, description, pass_text, show_progress)
VALUES (23, 'Riddle me this', '....\n\nBring me something you fill with\nempty hands and I will reward you..', 'Very good...', '1');
INSERT INTO quests (id, name, description, repeatable, show_progress)
VALUES (24, 'City Information', 'North\nTavern (Class Quests and Spell Vendors)\nGambling Hall(Character Customization)\n\nEast\nCombine Ingredients\n\nNorthwest\nBank', '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, show_progress)
VALUES (25, 'City Scroll', 'Greetings player!\nI see you''ve been training hard! \nIf you manage to get to level 25, \nhit NEXT and I''ll grant you the spell to\n this town!', 'Congratulations!\nEnjoy this spell for Patrian!\nYou''ve earned it!', 'Please reach level 25, and come \n back to speak with me for your reward!', 25, 50, '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, show_progress)
VALUES (26, 'City Scroll', 'Greetings player!\nI see you''ve been training hard! \nIf you manage to get to level 25, \nhit NEXT and I''ll grant you the spell to\n this town!', 'Congratulations!\nEnjoy this spell for Ipcus!\nYou''ve earned it!', 'Please reach level 25, and come \n back to speak with me for your reward!', 25, 50, '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, min_level, show_progress)
VALUES (27, 'Road to Serpentinia', 'Halt!!! Only those with\n75M EXP may enter this\n area and SSSSURVIVE!\nIf you have the required amount\n of EXP, enter with caution!\nCarry on adventurer!', 'As I Sssssaid...carry on!', 'You don''t have enough EXP!\nTurn around if you want to live!', 75000000, 50, '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (28, 'Dark Forest Toll', 'Ye there! Stop! Pay up\nor suffer the consequences\n me thinks you should purchase a trinket\n from Enkei and come back!\n He''s hiding out near Event Hall trying to\nwell...get more "loot" lets say! Hehehe.', 'Good, good! Thank ye! Now ye\n may enter our forest...but ye\n may not exit...with ye life! HAHAHA!', 'Pay up or fak off, you!', 45, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, show_progress)
VALUES (29, 'Crown of Patrian', '1', 'Very good citizen!\n I now present you with the Crown of Patrian!\n Wear this so all her people will know you have\n done a great service for Patrian!', 'You still have not slain Pirate King Zinamou!\n If you do not slay him, I have nothing for you!\n Now GO!', 50, '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, show_progress)
VALUES (30, 'Clown Killer', 'Hey there freak! Can you do me\n a favor? Hehehehe! Goooood\n go in there and find my old coworkers\n and kill 25 of them for me?\n\nCan''t have the Guards suspecting me,\n now can we?', 'Thank you, here''s a....reward.\nHahahaha! Hehehehe!\Goodbye now freak!', 'Oh no no no. Kill them all!\n25 of them outta do!', 43, '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, show_progress)
VALUES (31, 'Fray''s Sorrow', '*Sobs* H-h-hey there stranger...\nCould I bother you for a minute? Thank\nyou. You see my...my "friend" Hay\nhe and I used to be close, now he\nhas abandoned me forever.\nIf  I can''t have him nobody can!\n Kill him, and bring me 10 of his\nparty invitations from around the\nmansion! *Sobs* I''ll even grant you\nthe title of "Slasher".', 'Thank you stranger! *Grimaces*\nServes him right that BASTARD!\nHere, take his Slasher as a reward!\n*Siniter smile* He won''t need it...\nAlso take 20k gold, you did me\nthe ultimate favor! ', 'I said 10 invitations, and his blood\n on your hands! Please hurry\nI can''t bare to be without\nhim any longer. *Sobs*', 43, '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress)
VALUES (32, 'Helful Hints Level 10', 'Hey there! I''m Washington!\nPleased to meet you, can you\ndo me a solid? Just go to the left\nover there, behind the trees. You''ll\nfind a hidden entrance to the cave\nthere!\n\nKill 10 of those pesky blue colored\nslimes? I''ve got some Gold\nfor you, if you do! I''ll also grant\nyou the title "Slime Slayer".', 'Thanks kindly. Here''s some Gold\nfor your troubles!', 'No no, kill me 10 of the\nblue ones! Or no pay!', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress, prerequisite_quests)
VALUES (33, 'Helpful Hints Level 15', 'Hello! Nice to meet you!\nI have a favor to ask you.\nThere seems to be an issue\nwith ghosts in the house in\nScanty Plains. Go to the North\nabove the Castle, then take an\nIMMEDIATE left. Kill me 15\nStompy Ghosts, there''s some\nGold in it for you, if you do!', 'Thanks friend! Take this Gold\nfor your hard efforts. I''m\nsure the townsfolk will be much\nhappier with less ghosts!', 'Not yet, still need more\nStompy Ghosts buddy! Kill\n15 total and come back!', '1', '32');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress, prerequisite_quests)
VALUES (34, 'Helfpful Hints Level 20', 'Yeah? What the hell do you\nwant? Actually, I don''t care. Go\nSouth of Patrian, follow the road,\nat the fork in the road towards\nthe bottom, take the left fork. Go\nEast once you hit the sand. Kill\nme 20 of those bastard Seashore\nBrigands. There''s Gold in it\nfor you. Now go away ye prick!   ', 'Yeah whatever, thanks I guess...\nI could''ve done it 10 times faster\nme self. Git yer ass away from\nme. Arrrgh.', 'Apparently, ye must''ve hit yer\nhead! I said 20 of those bastard\nwannab-be pirates. Now git!', '1', '32 33');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress, prerequisite_quests)
VALUES (35, 'Helpful Hints Level 25', 'Howdy! I''m Billjack! Do me a favor,\nwould you? Go to the Road to\nIpcus, go straight down, then take\nthe fork on the right all the way\nto a cave entrance. Kill me 25\nof those green imps, and come\nback. I got a few coins for you, if\nyou''re successful! What do you say? ', 'Good job! Thank you soo\nmuch. Those pesky things stole my\nbackpack... Truth be told, I''m\ntoo scared to go back. Hahaha.\nBe safe out there!', 'Oh, it looks like you still have\na few more to kill. Come back\nwhen you''re done pal!', '1', '32 33 34');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress, prerequisite_quests)
VALUES (36, 'Helpful Hints Level 30', 'Hi. You seeking adventure? I have\nthe perfect area for you! Go to the\nNorthWest corner of Ipcus, there\nyou''ll find the Scarlet Forest. Kill\n10 Gorc Lashers and 10 Feral\nFelines. I''ll pay ya! As an added\nbonus, I''ll grab you the\nSurname "the Feral Renegade"', 'Thank you! Here''s your money,\nas promised!', 'Hmm...looks like you''re still missing\nsome. I need 10 Gorc Lashers and\n10 Feral Felines dead.', '1', '32 33 34 35');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress, prerequisite_quests)
VALUES (37, 'Helpful Hints Level 35', 'Greetings! Are you looking for\nanother place to round up some gear?\nYou outta check out the Sewers in\nMaloha. Go to Pirates Landing, down\nby the dock, and talk to the greeter.\nIn Maloha Isle, go south to the\nsecond house, and go downstairs,\nkill me 25 Black Mice, and I''ll pay\nyou nicely.', 'Good work! Here''s your pay!\nThank you.', 'You''re missing a few Black Mice,\nmy friend. Come back when the\njob is done.', '1', '32 33 34 35 36');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress, prerequisite_quests)
VALUES (38, 'Helpful Hints Level 40', 'Head on over to the Carnival\nof Despair for your next set of gear\nand weapons. If you kill me 25\nof those blasted Cotton Candies\nI''ll pay you some gold.\n\nJust remember to come back\nbefore Level 49, or you won''t be\nable to get back in to retrieve\nyour Gold.', 'Thanks! The Carnival would be\nbetter if everything wasn''t so damn\nevil. Here''s your gold!', 'Remember 25 of them,\nTHEN I''ll pay you.', '1', '32 33 34 35 36 37');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress, prerequisite_quests)
VALUES (39, 'Helpful Hints Level 45', 'Can you help me? Those Undead\nPerformers blocking the entrance.\nWill you kill them for me, so I can\nget in to see Punchy? Kill 30 in\ntotal, if you do I''ll pay you a\nhefty sum!', 'Thank you! I just wanted to see\nPunchy, I''ve heard the Legends,\nmaybe I''ll see Hay and Fray too!', '30 total, then come back for your\ngold! Thanks again!', '1', '32 33 34 35 36 37 38');
INSERT INTO quests (id, name, description, pass_text, repeatable, show_progress)
VALUES (40, 'Title Remover', 'Hey there! Tired of your old Title,\nand just want it out of here? I can\nhelp you with that! For the small fee\nof 1,000 GP I will remove your\nTitle for you!', 'Alright! You''re all set! No more\nTitle to worry about! Thank you,\nhave a great day adventurer!', '1', '1');
INSERT INTO quests (id, name, description, pass_text, repeatable, show_progress)
VALUES (41, 'Surname Remover', 'Hey there! Tired of your old Surname,\nand just want it out of here? I can\nhelp you with that! For the small fee\nof 1,000 GP I will remove your\nSurname for you!', 'Alright! You''re all set! No more\nSurname to worry about! Thank you,\nhave a great day adventurer!', '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress)
VALUES (42, 'Dark Renegade Quest', 'Greetingsss young one!\n\nYou must be new here to Ssserpentinia.\nI tell you what, if you''ve got sssome\ntime, would you mind doing an\nold man a favor? Go to Forlorn Road,\nand rid my foressst of 40 of thossse\nnasssty ssspiritsss? I''d be eternally\ngrateful young one.\n\nI''ll grant you a title of "Dark Renegade"\nand give you 40k Gold piecesss too! ', 'Thanksss sssooo much!\n\nYou''ve helped my village more\nthan you know! Here, take thisss title\nof "Dark Renegade", and thisss\n40k Gold!', 'Sssorry, you must kill 40 of the\nssspiritsss, or I cannot pay you.\n\nKeep at it!', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, repeatable, show_progress)
VALUES (43, 'Enhanced God Weapon', 'Hello there Adventurer!\n\nI would like to be the first to congratulate\nyou in your travels. You''ve come a\nlong way, since your first day. If you''re\nhere, that means you''ve achieved at\nleast 3.2B EXP sold. You may now\nbegin one of your final quests, before\ndeparting to the Astral Realms,\nCastle Relex, Death and many other\nhigh powered, high sold maps.\n\nIf you have already purchased your\n5M Gold weapon you may\nstart this quest. It will not be an easy\none. I need you to kill 1K of each\nNPC of EACH Vita Genero Map.\nOnce you''ve done this come\nback, and contact me.\n\nTHIS QUEST DOES NOT INCLUDE BOSSES!', 'Congratulations! You''ve passed the test!\n\nThat was no easy task, at all! I didn''t\nthink you''d actually achieve it.\nNow here''s your reward, take this\nMedallion as proof of your power.\nYou may trade it, along with your\n5M weapon, and 2M Gold, and you\ncan unlock the TRUE power held\nwithin your weapon! You will NOT\nregret this, it is time, and money\nWELL SPENT.', 'I''m sorry, but you need to kill 1K\nof EVERY NPC in EVERY Vita Genero\nmap, have your 5M weapon from\nthe Arms Dealer in Dark Passage,\nand an additional 2M Gold to\ncomplete this quest!\n\nYour 5M weapon will be traded\nto the vendor of your class. I will\nNOT take this from you!', '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress)
VALUES (44, 'Warrior''s Path of the Gods', 'In exchange for your Medallion,\nand your Barbarian''s Forgotten Slasher,\nI will now unlock the true power of\nyour BFS! Give me the items I\nseek, and I will enhance your blade!', 'Here you are, your sword has been\nenhanced! Enjoy its power, but weild\nit carefully! It''s more than twice as\npowerful as your old blade.', 'I''m sorry, but you do not have\nthe required items to complete this\nquest. Please come back when\nyou''ve completed all of the\ntasks Adventurer!', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress)
