VALUES (46, 'Priest''s Path of the Gods', 'In exchange for your Medallion,\nand your Whip of Thorns,\nI will now unlock the true power of\nyour weapon! Give me the items I\nseek, and I will enhance your whip!', 'I have changed your Whip into\nit''s true form. It is now the Staff of\nthe Gods! Enjoy it''s power, but be\ncareful, your whip paled in\ncomparison with this ancient beast!', 'I''m sorry, but you do not have\nthe required items to complete this\nquest. Please come back when\nyou''ve completed all of the\ntasks Adventurer!', '1');
