INSERT INTO quests (id, name, description, repeatable, show_progress)
VALUES (48, 'Tweedle Bros Transport', 'You wanna to go to the Event Hall?\nI can take you there for 500 gold pieces.\n\n we have a deal there bud?', '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (49, 'Oculus Arena Lvl 50', 'Welcome to the brotherhood\nof Oculus freshblood! So you want\nthe Oculus Robe do ya? Well you\nhave to earn it. Slay these monsters\ninside, and I''ll give you\n(1) Oculus Shard!', 'Congratulations freshblood!\nYou earned yourself 10k gold an\n (1) Oculus Shard! Come back\ntomorrow for more!', 'You seem to be missing some credits\nfor today''s Shard!\nTry again later!\nYou need 14 minions and 1 Boss\nto comeplete this quest!', 50, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, min_level, repeatable, show_progress)
VALUES (50, 'Oculus Arena 50M', 'Welcome to the brotherhood\nof Oculus, Member! So you want\nthe Robe Upgrade do ya? Well you\nhave to earn it. Slay these monsters\ninside, and I''ll give you\n(1) Oculus Shard!', 'Congratulations Member!\nYou earned yourself 20k gold an\n (1) Oculus Shard! Come back\ntomorrow for more!', 'You seem to be missing some credits\nfor today''s Shard!\nTry again later!\nYou need 14 minions and 1 Boss\nto comeplete this quest!', 50000000, 50, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, min_level, repeatable, show_progress)
VALUES (51, 'Oculus Arena 500M', 'Welcome to the brotherhood\nof Oculus, Sr Member! So you want\nthe Robe Upgrade do ya? Well you\nhave to earn it. Slay these monsters\ninside, and I''ll give you\n(1) Oculus Shard!', 'Congratulations Sr Member!\nYou earned yourself 25k gold an\n (1) Oculus Shard! Come back\ntomorrow for more!', 'You seem to be missing some credits\nfor today''s Shard!\nTry again later!\nYou need 28 minions and 1 Boss\nto comeplete this quest!', 500000000, 50, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, min_level, repeatable, show_progress)
