INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, show_progress)
VALUES (53, 'Oculus Robe Lvl 1', 'So you want to unlock the Oculus''s\npower? Fine! Bring me 10 shards,\nand I''ll unlock the Oculus Robe\nLvl 1!', 'Shiimooanaa! Tee-hee!\nThere we go! Just be careful...', 'You don''t seem to have enough\nshards! Please collect more,\nand come back when you have\n7 shards!', 50, '1');
