INSERT INTO quests (id, name, description, pass_text, fail_text, repeatable, show_progress)
VALUES (57, 'Mini-Game Machine 50', 'Exchange 50 Mini-Game Tickets for:\n\n(1)Custom Dye Voucher\n\n(500,000)Gold Pieces ', 'Congratulations! Here are your items!', 'You still need more Mini-Event tickets\nto complete this task!', '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, repeatable, show_progress)
VALUES (58, 'Mini-Game Machine 100', 'Exchange 100 Mini-Game Tickets for:\n\n(1)Custom Mount Voucher\n\n(1)Body Dye Voucher\n\n(1,000,000)Gold Pieces', 'Congratulations! Here are your items!', 'You still need more Mini-Event tickets\nto complete this task!', '1', '1');
