INSERT INTO quests (id, name, description, pass_text, fail_text, repeatable, show_progress)
VALUES (60, 'Class Removal', 'So you don''t like your class? For a fee \nof 250,000 gp I can remove your class and\nchange you back into a Commoner.\n\nThis procedure is not easy and 7% of your\ntotal experience will be lost in the\nprocess.\n\nIf you still want to do this, strip \ncompletely naked, remove all rings and\naccessories. Then let''s begin!', 'Congratulations it was successful.\nYou are now a Commoner.\nHere is a class gem to choose\nyour new class.', 'Are you completely naked?\nWhere is my gold?\nThis is an expensive procedure!', '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, max_experience, min_level, max_level, repeatable, show_progress, only_one_player_can_complete)
VALUES (61, 'Red Egg Bobby', 'Could you help me? Some of me and my\nbrothers bunnies got to hoppin'' and\nran off. We were testing them to lay\ncoloured eggs, could you bring me\nback my favorite one? A red one! I\n have some money for your troubles!\n\nReward: 100,000 GP', 'Gee Thanks! I can''t believe you\nactually managed to grab me one\nof these! Here''s ya some money!', 'Uhhh... where is it?', 0, 0, 0, 50, '0', '1', '0');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, max_experience, min_level, max_level, repeatable, show_progress, only_one_player_can_complete)
VALUES (62, 'Brother Ross Da Boss', 'Aye could you help me?\nSome of our bunnies got\nto hoppin'' and ran off\nWe tested them to lay coloured eggs,\ncould you bring me my favorite one?\ntryna'' sell it for some GP ya know..\none of our bunnies weren''t colored so\nif you can get me my egg I got a item\nfor you that we made from him! Bring\nme a golden one please!\nit''s my favorite.\n\nReward: 1x Boing! Boing! Ears', 'Preciate it mane! Happy easter from\nIllutia Goose 2019 enjoy you some ears!', 'Don''t be tryna hustle me mane!', 0, 0, 0, 50, '0', '1', '0');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, max_experience, min_level, max_level, repeatable, show_progress, only_one_player_can_complete)
VALUES (63, 'Blue Egg Eddie', 'Could you help me? Some of me and my\nbrothers bunnies got to hoppin'' and\nran off. We were testing them to lay\ncoloured eggs, could you bring me\nback my favorite one? A blue one! I\ncan reward you with this weird paint\nI had found at a body & skin vendor.\nat a place nobody else can get to.\n\nReward: 1x Body Dye: White', 'Enjoy! I bet it will look good on you!', 'Uhhh... where is it?', 0, 0, 0, 50, '0', '1', '0');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, max_experience, min_level, max_level, repeatable, show_progress, only_one_player_can_complete)
VALUES (64, 'Purple Egg Lonnie', 'Could you help me? Some of me and my\nbrothers bunnies got to hoppin'' and\nran off. We were testing them to lay\ncoloured eggs, could you bring me\nback my favorite one? A purple one! I\ncan reward you with these weird\narcade tokens.\n\nReward: 5x Mini-Game Tickets', 'Thanks friend! You were heaps of help\nenjoy this as a present! I found them\nin Loki''s pocket!', 'Uhhh... where is it?', 0, 0, 0, 50, '0', '1', '0');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, max_level, repeatable, show_progress, only_one_player_can_complete)
VALUES (65, 'Party Reward Pete', 'Hello there! If you can help me by\nclearing a couple of monsters for me\nI would really appreciate it. Of\ncourse I would reward you and your\nteam for your efforts! Experience\nmaybe? Kill 5,000 of each monster for\nme. To put a stop to these monsters\n\nReward: 1,000,000 Experience', 'Thank you so much brave soldiers!\nEnjoy your experience you deserve it!/n', 'Quit trying to cheat me you hooligans\nget back out there or no reward!', 50, 50, '1', '1', '0');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (66, 'A Little To Gamble', 'Hey there traveler!\n\nWanna take a break from the daily grind?\nWell, if you''ve got some extra Punchy\nTokens, I can exchange them for you for\nsome Gold!\n\nConversion Rates:\n\n25 Tokens = 250,000 Gold', 'Congratulations traveler!\n\nHere is the gold, as promised.', 'It would seem that you do not have enough\nPunchy Tokens to make this exchange.\n\nPlease come back when you have 25 Tokens!', 25, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (67, 'Beep Boop Beep', '... ... ... ... ...', 'Tokens Dispensed: 1', 'ERROR!\n\nPlease insert 10 Crystals to power on!', 25, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (68, 'Beep Boop Beep', '... ... ... ... ...', 'Tokens Dispensed: 10', 'ERROR!\n\nPlease insert 80 Crystals to power on!', 25, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress)
VALUES (69, 'Slay the Zombies', 'Hey adventurer, these zombies have\ntaken over our town, can you help\nkill some? Just don''t get bitten!\nMaybe 500 of each?', 'Wow! You did it without a bite to ya.\nHere''s your reward buddy!', 'Get back out there!', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, show_progress)
VALUES (70, 'Save the Souls', 'This is sad to see... Please!\nTake back the evil that plagues these\nsouls! The leaders they hold the\ncurse. Slay them!', 'Thank you! For saving the souls of\nthese enslaved lutians, my people\ncan return home now! Here''s your reward', 'Please! Save my people!', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_experience, min_level, repeatable, show_progress)
VALUES (71, 'Just a quickie...', 'So you heaard I have 100% pure\nEXP in my house didja?\n\n*Spits*\n\nWell ya herd right...now make the\nshit quick... get in get what you need\nand get outta my house! Ya hear?\n\nIt''ll cost ya 5k!', 'Go on now, get.', 'This shit ain''t free ya hear?\nCome back when you have the\ndough. Skidaddle punk.', 200000000, 50, '1', '1');
INSERT INTO quests (id, name, description, pass_text, fail_text, min_level, repeatable, show_progress)
VALUES (72, 'Priestless Blessing', 'Hi there, adventurer. So you don''t have a\npriest to group with?\n\nFor 20,000 gold I can give you a buff\nthat you will enjoy. The buff will last\n35 minutes.\n\nNote: The buff will stop if you group with\na priest. Don''t want to make it too easy\ndo we?', 'Go and kill stuff.\nSee you in 35 minutes.', 'Go get my money, then I''ll buff you.', 50, '1', '0');


